INSERT INTO `catalog_pages` (`id`, `parent_id`, `caption`, `icon_image`, `visible`, `enabled`, `min_rank`, `min_vip`, `order_num`, `page_link`, `page_layout`, `page_strings_1`, `page_strings_2`) VALUES
(1, -1, 'Front Page', 213, '1', '1', 1, 0, 1, 'frontpage', 'frontpage4', 'catalog_frontpage_headline_shop_GENERAL|', '<i><b><font color=\"#0E668C\" size=\"16\">What can I find in the shop?</font></b></i><br><br>Upgrade your clothing with Habbo Club, adopt a pet or decorate your room the way you like it. Whatever you like to do most in Habbo, you\'ll find a way to make that experience even better by browsing our Shop.<br><br><li>Join <a href=\"event:catalog/open/habbo_club\">Habbo Club</a></li><li><a href=\"event:catalog/open/set_pixelnew\">Decorate </a>your room</li><li>Adopt a <a href=\"event:catalog/open/pets_shop\">Pet</a> or a <a href=\"event:catalog/open/bots\">Bot</a></li><li>Make your own <a href=\"event:catalog/open/category_wired\">Wired</a> games </li><li>Trade in our <a href=\"event:catalog/open/marketplace_offers\">Marketplace</a></li><br><i><b><font color=\"#0E668C\" size=\"16\">Where can I get credits?</font></b></i><br><br>We have a couple of methods of payment such as Credit Cards and PayPal which allow you to purchase credits at our Web Shop.<br><br><a href=\"https://easybuy.pw/packages/currency\" target=\"_new\">Visit our currency page for more info.</a>|Redeem a voucher code here:'),
(3, 9224, 'Classic Furni', 2, '0', '0', 1, 0, 14, '', 'default_3x3', 'catalog_frontpage_headline2_en|', '|'),
(4, 9224, 'Pixel Shop', 5, '0', '1', 1, 0, 24, '', 'default_3x3', 'catalog_frontpage_headline2_en|', '|'),
(5, 9224, 'Habbo Club', 172, '1', '1', 1, 0, 3, 'habbo_club', 'recycler_info', 'habboclub_2|VIP_badge', 'Habbo Club is free and you get in when you start. Although you can buy VIP read more about that below.|VIP is avaliable from Habbo.com/store/vip for $40USD\\r\\r\r\nYou get the following features with VIP:\\r\r\nPush/Pull commands, VIP Catalogue including cool rares\\r\r\nand heaps of cool other features. So why not get it now?\\r'),
(6, 9224, 'Silver VIP', 196, '1', '1', 1, 1, 30, '', 'default_3x3', 'vipheader1|vipteaser2', 'Thank you for purchasing VIP! This section of the catalogue is especially for our VIP users. The Rares in this section aren\'t cheap, but you can sell them on to non VIP members for a much heftier price!|Click on an item for more information.'),
(7, 5, 'Buy Club', 75, '0', '1', 1, 0, 3, '', 'default_3x3', 'habboclub|catalog_hc_teaser', 'Habbo club comes with many bonuses! More hair and clothes choices, more hair and clothes colours to come from, new room layouts, new dances, and much, much more!|'),
(8, 5, 'Club Shop', 172, '1', '1', 1, 0, 20, '', 'default_3x3', 'catalog_header_hc|hc_catalog_teaser', 'As a member of Habbo Club you can shop from this selection of exclusive items.'),
(9, 9224, 'Bots', 65, '1', '1', 1, 0, 16, 'bots', 'bots', 'catalog_bots_headline1_en|catalog_bots_headline1_en', 'They walk, they talk, and they make the perfect addition to any room!|Choose a bot of your fancy!\\nNote: You can customise your bot once its in your room'),
(10, 9224, 'Marketplace', 69, '0', '1', 1, 0, 27, '', 'pets3', 'catalog_marketplace_header_en|catalog_note_marketplace', 'The Habbo Marketplace is a convenient and safe way to buy and sell items in Habbo.|How does the Habbo Marketplace work?|Selling items: You can sell any item which is tradable by selecting the item in your inventory and clicking on \"Sell in Marketplace\". You can also use items currently in the shop.\r\n\r\nBuying items: Browse for the item you want to buy on the Marketplace Offers page and click Buy. We guarantee you\'ll get the item at the cheapest price available at the moment of purchase.|'),
(11, 10, 'My Sales', 70, '1', '1', 1, 0, 1, '', 'marketplace_own_items', '', ''),
(12, 10, 'Offers', 71, '1', '1', 1, 0, 2, 'marketplace_offers', 'marketplace', '', ''),
(13, 9224, 'Habbo Exchange', 146, '1', '1', 1, 0, 1, '', 'default_3x3', 'catalog_bank_headline1|catalog_bank_teaser', 'You can exchange your Habbocredits here for Exchange furniture, which you can use in a trade or simply exchange for actual credits.|'),
(14, -1, 'Pet Shop', 8, '1', '1', 1, 0, 3, 'pets_shop', 'pets3', 'catalog_pet_headline1|ctlg_pet_note', 'Pets are inhabitants of Habbo Hotel too so each pet owner needs to know a bit about them. If you want to look after your pet properly, make sure you read the following points carefully.|A few things you should know:|*You can place a pet in your room or take one for a walk with you in other rooms.\r\n*You can\'t trade your pet but they can follow you to friend\'s rooms to gather scratches.\r\n*You can have up to 50 pets in your room, but look after them all!\r\n\r\n\r\n*Look after your pet with food, water and treats. Check the Pets\' Accessories.\r\n*Unlock Badges and Achievements by Training your Pet.|Click your Pet and hit the \"Train\" button to get a list of commands that will level up your Pet in no time!'),
(15, 9020, 'Spaces', 225, '1', '1', 1, 0, 14, 'set_pixelnew', 'spaces_new', 'catalog_spaces_headline1|', 'Floors, wallpapers and landscapes - get a groovy combination for your room! Use our sample room below to try before you buy! Select your favourite designs and colours and simply click Buy!|'),
(16, 9224, 'Limited Rares', 145, '1', '1', 1, 0, 9, '', 'default_3x3', 'limited_header|', 'Get them while they\'re hot! Limited Edition Rare Furni is only available in limited quantities and once we\'ve sold out, they\'re gone! Each furni can be identified by its unique ID number and the LTD logo beside them!|'),
(18, 9224, 'New Furni', 2, '0', '0', 1, 0, 12, '', 'default_3x3', 'catalog_frontpage_headline2_en|', '|'),
(19, 9021, 'Cinema 2013', 136, '1', '1', 1, 0, 54, '', 'default_3x3', 'cinema_catalogheader|movie_catalog_teaser', 'All the way from Habbowood... Everything you could need and more to create your very own movie magic in a home theatre!|'),
(20, -1, 'Clothing', 74, '1', '1', 1, 0, 4, 'clothing', 'default_3x3', 'clothing_catalog_header|tradeableclothing_teaser', 'The all NEW Habbo Couture tradeable clothing and accessories range is a cut above the rest! From stylish tops and jeans, to amazing accessories and hair; Habbo Couture lets you express yourself to the extreme!'),
(21, 9049, 'Gnomes', 200, '1', '1', 1, 0, 5, 'xmas14_gnome', 'default_3x3', 'xmas14_catalog_header|xmas14_gnome_teaser', 'The North Pole can be a tough place for a little Gnome, so this year they\'ve migrated to the sunny shores of Habbo Islands. Feed them, train them and treate them with care...'),
(22, 9021, 'New Years 2015', 2014, '1', '1', 1, 0, 156, '', 'default_3x3', '2015_header|catalog_2015_header', ''),
(24, 9020, 'Windows', 218, '1', '1', 1, 0, 20, '', 'default_3x3', 'ctlg_windows_headline1_en|ctlg_windows_teaser1_en', 'Let some light in! Our windows come in many unique styles to give an exciting look to your room. Buy landscapes to go with your windows from the \'Spaces\' page!|'),
(26, 9020, 'Moodlights', 40, '1', '1', 1, 0, 4, '', 'default_3x3', 'catalog_dimmers_header_en|dimmers_teaser', 'Our range of moodlights allow you to control the atmosphere and transform your room in just a click. What will your room look like? Click the switch and find out now!|'),
(27, 9021, 'Christmas', 168, '1', '1', 1, 0, 56, '', 'default_3x3', 'catalog_xmas_headline1|xmas2009_catalogue', 'Get yourself into the Christmas spirit with our selection of festive furni! From baubles to reindeer poo, we\'ve got it all!|'),
(28, 9021, 'Arctic', 13, '1', '1', 1, 0, 14, '', 'default_3x3', 'catalog_arc_header1_en|catalog_arc_teaser1_en', 'Stay cool (or warm with our campfire!) and create your own Winter Wonderland or Humble Homeland for your penguins.|'),
(29, 9020, 'Teleporters', 120, '1', '1', 1, 0, 16, '', 'default_3x3', 'catalog_doors_headline1|catalog_teaser_teleporters', 'Take your room to a whole new level with our range of space age teleporters! Just buy a pair, put one in each room and voila! You\'ll have two linked rooms!|'),
(30, 9021, 'Mode', 39, '1', '1', 1, 0, 144, '', 'default_3x3', 'catalog_mode_headline1|catalog_mode_teaser1', 'Steely, grey, industrial standard metal with a sleek design. The perfect range for a streetwise city dweller.|'),
(31, 9021, 'Candy', 19, '1', '1', 1, 0, 42, '', 'default_3x3', 'catalog_candy_headline1|catalog_candy_teaser1', 'A bit more feminine than \'Mode\', this will add a bit of glamour and glitz to your rooms. Lacking a few items? Head on over to the \'Mode\' category!|'),
(32, 9021, 'Pura', 48, '1', '1', 1, 0, 176, '', 'default_3x3', 'puraheader|catalog_pura_teaser1', 'The cleanest, freshest range. You can almost hear it breathe cool and tranquility within your room. Use it to create a haven away from the hectic lifestyle of Habbo Hotel.|'),
(33, 9021, 'Area', 14, '1', '1', 1, 0, 16, '', 'default_3x3', 'catalog_area_headline1|catalog_area_teaser1', 'A chunky and sofisticated line for the down-to-earth, studious Habbo. Its simplicty is beautful and will add a welcoming charm to every room.|'),
(34, 9021, 'Country', 21, '1', '1', 1, 0, 68, '', 'default_3x3', 'country_header1_en_001|country_teaser1', 'Let\'s leave the busy city streets and head over to the wide abyss of golden wheat, emerald fields and home grown, organic vegetables. Everything you need to create a farm!|'),
(35, 9021, 'Lodge', 37, '1', '1', 1, 0, 130, '', 'default_3x3', 'catalog_lodge_headline1|catalog_lodge_teaser1', 'For that splendid ski-lodge effect with an open fire and whisky on the sidebar. This range is for those who appreicate the true beauty of solid wood.|'),
(36, 9021, 'Plastic', 46, '1', '1', 1, 0, 168, '', 'default_3x3', 'catalog_plasto_headline1|', 'Throw on an afro and grab a disco ball! Feel that retro, 1970s vibe? You soon will with this colourful, plastic range! Choose a colour to suit your mood and off you go!|'),
(37, 9021, 'Lagomorph', 192, '1', '1', 1, 0, 126, '', 'default_3x3', 'catalog_header_easter14_001|catalog_lagomorph_teaser', 'From shape shifting wall pieces to crpytic teleports, the isle of Lagomorph furni line is sure to keep you guessing! Nothing is as it seems on this mind-bending island...'),
(38, 9021, 'Bathroom', 17, '1', '1', 1, 0, 26, '', 'default_3x3', 'catalog_bath_headline1|catalog_bath_teaser1', 'Lets face it.. you can\'t live without your bathroom. Give your guests somewhere to freshen up with our cheeful bathroom collection!|'),
(39, 9020, 'Plants', 220, '1', '1', 1, 0, 6, '', 'default_3x3', 'catalog_plants_headline1|catalog_plants_teaser1', 'Every room needs some greenery, dear! Not only do they enhance the air quality, they cheer up a room to make it simply splendid! And what better gift for a friend than an elegant rose..|'),
(40, 9020, 'Rugs', 116, '1', '1', 1, 0, 12, '', 'default_3x3', 'catalog_rugs_headline1|catalog_rugs_teaser1', 'Rugs for all occasions, white for weddings, black for funerals and everything in between! All rugs are non-slip and machine washable. Take your pick!|'),
(41, 9020, 'Posters and Flags', 219, '1', '1', 1, 0, 8, '', 'default_3x3', 'catalog_gallery_headline1|catalog_posters_teaser1', 'Adorn your walls with posters, art, plaques and wall hangings. This gallery is bursting with items to suit all tastes, traditional and modern!|'),
(42, 9021, 'Trophies', 60, '1', '1', 1, 0, 210, '', 'trophies', 'catalog_trophies_headline1|', 'Everyones a winner with Habbo trophies! Now you can reward all your friends with our pre-polished array of trohpies, in bronze, silver and gold. \r\nFirst choose your trophy model, then the metal, and carefully type your inscription. Don\'t worry, we\'ll engrave it all with your name and the date.|'),
(43, 9021, 'Accessories', 11, '1', '1', 1, 0, 2, '', 'default_3x3', 'catalog_extra_headline1|catalog_extra_teaser1', 'However you like to place your essentials, its the finishing touches that really make a room and express your true personality. Don\'t forget, like anything else, you can move them all about to suit your mood!|'),
(45, 4, 'Rentals', 44, '1', '1', 1, 0, 230, '', 'default_3x3', 'catalog_pixelrent_headline1_en|catalog_pxl_teaser3_en', 'Hire some cool effects to add an explosive touch to your room. From bubbles to firestarters, you can enhance your room dramatically!|'),
(46, 5, 'HC Executive', 172, '1', '1', 1, 0, 51, '', 'default_3x3', 'catalog_header_hc|hcexec_teaser', 'Habbo Club is back! With a new range of furniture; HC Executive!'),
(47, 9021, 'Base', 179, '1', '1', 1, 0, 24, '', 'default_3x3', 'catalog_header_base|base_rentable_teaser', 'This colourful range of furni has everything you need to style out your room and build great spaces.'),
(48, 9021, 'Health Spa', 211, '1', '1', 1, 0, 112, '', 'default_3x3', 'catalog_header_spa|catalog_teaser_spa', 'A day at the spa! Inhale...Exhale...Inhale...Exhale. With all the features of a premium Spa, you can now create your very own Habbo Health Spa relaxing retreat! Robe and slippers not included.'),
(49, 9021, 'Shakespeare', 59, '1', '1', 1, 0, 190, '', 'default_3x3', 'catalog_shakespeare_header|catalog_shakespeare_teaser', 'You can be the world\'s most famous poet! All you need to do is purchase the furniture below, be amazing at speaking and drink tea!'),
(50, 9224, 'Duckets Shop', 178, '1', '1', 1, 0, 13, '', 'info_duckets', 'duckets_header|', '<i><b><font color=\"#591d97\" size=\"16\">What are Duckets?</font></b></i><br><br>Ducket is a free virtual currency you can earn daily just by playing Habbo.<br><br><i><b><font color=\"#591d97\" size=\"16\">What are they good for?</font></b></i><br><br><li><a href=\"event:catalog/open/rentables_spaces\">Paint</a>  your rooms.</li><li>Get a <a href=\"event:catalog/open/duckets_cat\">cat</a> and <a href=\"event:catalog/open/duckets_petaccessories\">accessories</a>.</li><li><a href=\"event:catalog/open/rentables_info\">Rent furniture</a>.</li><li>Get <a href=\"event:catalog/open/special_effects\">avatar effects</a>.</li><li>Whatever fun stuff we come up with.</li><br><i><b><font color=\"#591d97\" size=\"16\">How can I get them?</font></b></i><br><br><li>Visit Habbo! Get some every day. The more active you are, the more you\'ll earn.</li><li>You get some for each completed achievement in the <a href=\"event:talent/open/citizenship\">Citizenship track</a>.</li><li>Any other surprise we might come up with!</li>|'),
(51, 9027, 'Extras', 28, '1', '1', 1, 0, 36, '', 'default_3x3', '', 'Feeling creative? You should be! Here is a full range of building blocks to create a master piece with!'),
(52, 9020, 'Badge Display', 224, '1', '1', 1, 0, 2, '', 'badge_display', '|', 'Got a badge that you want to flaunt off to others? Now is your chance!'),
(53, 50, 'Room Promo', 55, '1', '1', 1, 0, 3, 'room_ad', 'roomads', 'events_header|', '||'),
(55, 9021, 'Iced', 13, '1', '1', 1, 0, 114, '', 'default_3x3', 'catalog_iced_headline1|catalog_iced_teaser1', 'The Iced range: Squishy, soft and most definitely cool. Whatever your needs, this stylish range should cover it!|'),
(56, 9021, 'Alhambra', 12, '1', '1', 1, 0, 6, '', 'default_3x3', 'catalog_alh_headline1_en|dining_area_illustration', 'For the cold Arabian nights and hot Arabian days, you\'ll need a palace.. And we have just what you need! Green blossom print should cover it just fine!|'),
(57, 9021, 'Asian', 15, '1', '1', 1, 0, 18, '', 'default_3x3', 'catalog_asian_headline1|catalog_asian_teaser1', 'Ting tong! Ching chong? Ting chong ting, ping ping! I mean uh.. with our authentic Chinese furniture, you can make a beautiful oriental room!|'),
(58, 9021, 'Bensalem', 18, '1', '1', 1, 0, 28, '', 'default_3x3', 'catalog_lc_headline2_en|catalog_lc_teaser1_en_001', 'Under the seaaaaaaaaa, oh, Under the seaaaaaa! What will your underwater world look like? We have it all here, crabs, coral, and mythical sea creatures!|'),
(59, 9021, 'Easter 2011', 25, '1', '1', 1, 0, 80, '', 'default_3x3', 'catalog_easter_headline1|catalog_easter_teaser1', 'Little birdies hatching from their eggs, pretty, dainty flowers blooming and cute rabbits bouncy in Spring meadows.. It\'s Easter!|'),
(60, 9021, 'Executive', 27, '1', '1', 1, 0, 86, '', 'default_3x3', 'catalog_exe_headline1_en|catalog_exe_teaser_en', 'For the ultimate business man, the Executive range with its leather seats and Italian coffee is a dream! How about you try the easy lifestyle?|'),
(61, 9021, 'Glass', 29, '1', '1', 1, 0, 92, '', 'default_3x3', 'catalog_glass_headline1|catalog_glass_teaser1', 'You can really open up a space with this stylish glass furniture, just don\'t walk into it!|'),
(62, 9021, 'Gothic', 30, '1', '1', 1, 0, 94, '', 'default_3x3', 'catalog_gothic_headline1|catalog_gothic_teaser1', 'As the church bells ring out midnight, you walk through your cobbled hall lit by candles, throw yourself into your medieval throne and paint your nails black. This is what we imagined when we ordered this range!|'),
(63, 9021, 'Sports', 56, '1', '1', 1, 0, 196, '', 'default_3x3', 'sports|catalog_sports_teaser1', 'Sport contains all those vital Olympic pieces from running tracks to basketball courts! 3, 2, 1, GO!|'),
(64, 9021, 'Grunge', 32, '1', '1', 1, 0, 98, '', 'default_3x3', 'catalog_grunge_headline1|catalog_gru_teaser_en', 'Sleeping rough? Make the streets a bit more bearable with our collection of homeless furni, Grunge!|'),
