(66, 9021, 'Habboween 2011', 34, '1', '1', 1, 0, 102, '', 'default_3x3', 'catalog_halloween_headline1|catalog_voodoo_teaser', 'WooOOOOoooOOoo! Spooky! Don\'t wanna be left with this range at night.. who knows what would happen!|'),
(67, 9021, 'Japan', 36, '1', '1', 1, 0, 120, '', 'default_3x3', 'catalog_jap_headline1|catalog_jap_teaser3_en', 'We have sushi, tatami and katana\'s! I have no idea what the difference is, but I sure know its Japanese! Fulfil your fantasies and buy some today!|'),
(68, 9021, 'Lost Tribe', 38, '1', '1', 1, 0, 132, '', 'default_3x3', 'losttribe|LT_teaser_en', 'Start your own tribal village with our ancient furniture, all carved from hard wearing stone. NOTE: Lava is hot, get an adult to help you.|'),
(69, 9021, 'Neon', 41, '1', '1', 1, 0, 152, '', 'default_3x3', 'catalog_neon_header1_en|catalog_neon_teaser1_en', 'New years eve, birthdays and every other day of the year, there\'s always an excuse for a party! So, why don\'t you buy some Neon furni!?|'),
(71, 9021, 'Relax', 49, '1', '1', 1, 0, 180, '', 'default_3x3', 'rela_header_en|rela_teaser_en', 'Relax after a busy day in the Welcome Lounge. Light a few candles, and chill out with a good read in a wicker chair. We understand the needs of a Habbo with a hectic lifestyle!|'),
(72, 9021, 'Romantique', 50, '1', '1', 1, 0, 182, '', 'default_3x3', 'catalog_romantique_headline1|catalog_rom_teaser_en', 'Found in a French barn, this sweet but sexily romantic range caters to every ladies needs. Just going to powder my nose!|'),
(73, 9021, 'Science Fiction', 53, '1', '1', 1, 0, 188, '', 'default_3x3', 'sf_header_en|sf_teaser_en', 'Blipblop blip blip blip.. Oooh.. what\'s this button do?.. You can find out exactly what it does with our new Scifi range, batteries included!|'),
