(141, 14, 'Pigs', 67, '1', '1', 1, 0, 20, '', 'pets', 'catalog_pet_headline1|', 'These little scamps were destined for the dining table until we struck a deal with a local farmer to rescue their cute pigtails! Adopt your little piglet today, all you need now is a name.|Name your Pig:|Pick a Colour:|Pick a breed:'),
(142, 14, 'Pet Accessories', 43, '1', '1', 1, 0, 30, '', 'default_3x3', 'catalog_pet_headline1|ctlg_pet_teaser1', 'This page has everything you need to give your pet the happy life it deserves. We\'ve got a huge selection!|'),
(143, 9021, 'Flower Power', 73, '1', '1', 1, 0, 88, '', 'default_3x3', 'flowerpower|2828998428_1', 'Woah! Far out man... let the petals take control. Lets collaborate on a hippy hideout and plant some seeds! Lucy in the sky with diamonds style eyy?!|'),
(144, 9021, 'Runway', 74, '1', '1', 1, 0, 184, '', 'default_3x3', 'runway_header_en|runway_teaser_en', 'Spice up your salon, hair parlour or boutique with our stylish yet practical range! From sewing machines to comfy seating, we\'ve got the perfect option for you.|'),
