(146, 9021, 'School', 130, '1', '1', 1, 0, 186, '', 'default_3x3', 'ruletheschool_header|catalog_school_teaser', 'Sick of being told what to do? Want to be the boss of someone else for a change? Well now you can with our very own school range!|'),
(147, 14, 'Terriers', 66, '1', '1', 1, 0, 26, '', 'pets', 'catalog_pet_headline1|', 'Good things come in small packages and Habbo\'s Terriers are no exception!|Name your Terrier:|Pick a colour:|Pick a breed:'),
(148, 14, 'Bears', 68, '1', '1', 1, 0, 2, '', 'pets', 'catalog_pet_headline1|', 'A large, heavy, mammal that walks on the soles of its feet, with thick fur and a very short tail. Fall in love with our adorable range of Bears that include the Grizzly and Polar varieties!|Name your Bear:|Pick a colour:|Pick a breed:|'),
(149, 14, 'Cats', 20, '1', '1', 1, 0, 4, '', 'pets', 'catalog_pet_headline1|', 'Fluff, whiskers, meows and purrs! You\'re about to enter the world of Habbo Cats. These cute little critters make great playmates and will keep you company if you look after them well. Find a new friend from our ever-changing selection.|Name your Cat:|Pick a Colour:|Pick a breed:'),
(150, 14, 'Dogs', 24, '1', '1', 1, 0, 10, '', 'pets', 'catalog_pet_headline1|', 'Wet noses, paws, yaps and woofs! You\'re about to enter the world of Habbo Dogs. An adorable and faithful servant awaits you with a wagging tail everytime they see you. Find a new friend from our ever-changing selection.|Name your Dog:|Pick a Colour:|Pick a breed:'),
(151, 14, 'Crocs', 22, '1', '1', 1, 0, 8, '', 'pets', 'catalog_pet_headline1|', 'Scaly skin, growls and snaps! You\'re about to enter the world of Habbo Crocs. Security for your room or to scare your friends a trustworthy and surprisingly loving companion can be yours. Find a new friend from our ever-changing selection.|Name your Croc:|Pick a Colour:|Pick a breed:'),
(152, 503, 'Football', 56, '1', '1', 1, 0, 4, '', 'default_3x3', 'WorldCup|worldcup_teaser', 'This furni range is a must have for any football fanatic!|'),
(159, 9021, 'Prison', 240, '1', '1', 1, 0, 170, '', 'default_3x3', 'prisonheader|prisonteaser', 'Hey, he\'s escaping! Just kidding, no one\'s getting out of these high security cells!|'),
(162, 9021, 'MTV Studio', 64, '1', '1', 1, 0, 148, '', 'default_3x3', 'MTV|teaser_studio', 'The MTV Studio range lets YOU be your own music producer!|'),
(167, 14, 'Lion', 76, '1', '1', 1, 0, 16, '', 'pets', 'catalog_pet_headline1|', 'Simba, is that you? Oh wait, it\'s just one of Habbo\'s adorable pet lions! Unlike real ones, these won\'t bite your arms off. And hey, now you can tell all those girls that you\'re a lion tamer, it\'s not technically lying!|Name your Lion:|Choose a colour:|Choose a breed:'),
(168, 14, 'Rhino', 77, '1', '1', 1, 0, 22, '', 'pets', 'catalog_pet_headline1|', 'Ever thought rhinos could be cute? Neither did we until we saw these pets released!|Name your Rhino:|Pick a Colour:|Pick a breed:'),
(169, 14, 'Spider', 95, '1', '1', 1, 0, 24, '', 'pets', 'catalog_pet_headline1|', 'One of the most feared creatures in nature, and perhaps the most misunderstood. The majority of Spiders are predators with sharp fangs that inject venom into their prey- but dont worry, these spiders wont bite you! Maybe...||Name your Spider:|Select your colour/breed:'),
(170, 14, 'Frog', 97, '1', '1', 1, 0, 14, '', 'pets', 'catalog_pet_headline1|', 'The Frog. Cute, green and slimy! Frogs come in a variety of weird colours and can be found all over the world. Frogs are great jumpers, and make great pets, but are harder to hold onto than a supermodel in a tornado.||Name your Frog:|Select your colour/Breed:'),
(171, 14, 'Chick', 107, '1', '1', 1, 0, 6, '', 'pets', 'catalog_pet_headline1|', 'Habbo is full of chicks (the pet kind!) Adopt your new born chicklet now and start training it to perform the Chicken Dance for your friends... it will be a show to remember!||Name your chick:|Pick a colour/breed:|'),
(172, 91, 'Special Offers', 28, '1', '1', 5, 0, 2, '', 'default_3x3', 'catalog_cltbs_header1_en|catalog_cltbs_teaser_en', 'Collectible furniture especially for you!|'),
