(179, 14, 'Monkey', 128, '1', '1', 1, 0, 18, '', 'pets', 'catalog_pet_headline1', 'This mischievous monkey has made his way into the hotel and into our hearts. From the tilted beret to his love of bunches of bananas- this Monkey is sure to liven up your Habbo life!||Name your Monkey:|Select your colour/breed:|'),
