(9026, 57895, 'Horse Jump', 226, '1', '1', 1, 0, 5, '', 'default_3x3', 'catalog_header_jumping_en|catalog_teaser_horsejump', 'Take your horse jumping with these new Furni! Build a formidable race course to test your steed and your riding skills and challenge your friends!'),
