(9036, 9224, 'Habbo Groups', 203, '1', '1', 1, 0, 15, '', 'guild_frontpage', 'catalog_groups_en|', 'Habbo Groups are a great way to stay in touch with your friends and share your interests with others. Each Group has a homeroom that can be decorated by other Group members, members can also purchase exclusive Group Furni that can be customised with your Group colours!| * Get together with people you get together with!\r\n * Co-op room decorating for group members\r\n * Show off your group badge!\r\n * Get some neat Furni in your group\'s colors!|What\'s So Great About Habbo Groups?'),
(9037, 9036, 'Group Furni', 28, '1', '1', 1, 0, 1, 'guild_custom_furni', 'guild_custom_furni', 'catalog_groups_en||', 'Show off your Group spirit with the new customisable Furni. Select your Group and then get your furni in your Groups colours.|Select a Furni or Group|'),
(9040, 50, 'Stacktiles', 28, '1', '1', 1, 0, 4, '', 'default_3x3', 'stackers|stackk', 'Stacking isn\'t your best profession? No need to worry, you can use Stacking Tools to stack now!|'),
(9041, 9020, 'Video TVs', 2055, '1', '1', 1, 0, 18, '', 'default_3x3', 'catalog_header_tv|yttv', 'Watch your favourite YouTube Videos with these new Televisions!|'),
(9044, 9021, 'Recording Room', 136, '1', '1', 1, 0, 178, '', 'default_3x3', 'header_studio|teaser_studio|', 'Build your very own VIP Recording Room with the awesome TV Studio Furni! Everything you need from amps and guitars, to lighting rigs and drum sets... You\'ll definitely be the hit of HabboPalooza 2014!'),
(9045, 9021, 'Palooza 2013', 187, '1', '1', 1, 0, 160, '', 'default_3x3', 'catalog_header_hbpalooza|catalog_teaser_hblooza', 'From tents galore to everything you need to build the perfect stage - all your old Palooza favourites are back! They are only here for a limited time so don\'t miss out!'),
(9046, 9021, 'Vikings', 208, '1', '1', 1, 0, 224, '', 'default_3x3', 'vikings_catalog_header|catalog_teaser_vikings', 'From weapon racks and heads on spikes, to ornate hand-carved wooden chairs and benches. This furni has everything you need and more to create the Viking village of your dreams. With furni available in clan colours, you can display your true loyalty with pride!'),
(9047, 9021, 'Palooza 2014', 227, '1', '1', 1, 0, 162, '', 'default_3x3', 'catalog_teaser_palooza', 'The new Habbo Palooza furni has arrived! Create carnivals, festivals, rodeos or whatever else you like!'),
