(9054, 9210, 'Badge Shop', 28, '1', '1', 1, 0, 1, '', 'default_3x3', '', 'Running low on swag? Buy a fresh new funky swagalicious badge!'),
(9056, 14, 'Baby Pets Shop', 228, '1', '1', 1, 0, 21, '', 'default_3x3', 'babypets_cata_header|babypets_teaser', 'They\'re friendly. They\'re cute. They\'re here to win your hearts. Who are they? Baby pets! ALL NEW Kittens, puppies, piglets are storming their way through the hotel and joining the Bear Cubs and Terriers. Available via breeding boxes or sale.'),
(9057, 9056, 'Puppies', 228, '1', '1', 1, 0, 6, '', 'pets', 'babypets_cata_header', 'So soft and cuddly, these playful pups are certain to melt your heart. From Labradors to Dalmatians, there\'s a breed for everyone!||Name your pet:|Select your color/breed:'),
(9058, 9056, 'Kitten', 228, '1', '1', 1, 0, 2, '', 'pets', 'babypets_cata_header', 'Leaping their way around Habbo, these fluffy furballs are here to steal your heart...andd your yarn!||Name your pet:|Select your color/breed:'),
(9059, 9056, 'Piglets', 228, '1', '1', 1, 0, 4, '', 'pets', 'babypets_cata_header', 'OINK! Partial to a good roll in the mud, these playful piggies have trotted into Habbo and are ready for fun!||Name your pet:|Select your color/breed:'),
